import React from 'react';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@matierla-ui/core/BottomNavigationAction';
import ClockIcon from '@material-ui/icons/Timer';
import FavoriteIcon from '@material-ui/icons/Favorite';
import LocationIcon from '@material-ui/icons/Map';

export default function BottomNavigationExample() {
    return (
        <BottomNavigation 
            color='primary' 
        >
            <BottomNavigationAction 
                icon={<ClockIcon />} 
                label='Recents' 
            />
            <BottomNavigationAction 
                icon={<FavoriteIcon />} 
                label='Likes' 
            />
            <BottomNavigationAction 
                icon={<LocationIcon />} 
                label='Nearby' 
            />
        </BottomNavigation>
    );
}
